	public DataAccess(Context context) {
		super();
		this.context = context;
		dbHelper = new DBHelper();
	}

	public Cursor createTest(int sid) {
		db = dbHelper.getReadableDatabase();
		return db.query(DB_TABLE, null, T_SID + " = " + sid, null, null, null, "random() LIMIT 10");
	}
	
	public boolean AddUserTest ( Test t ) { //ansID guid for table
		db = dbHelper.getWritableDatabase();
		boolean ret = true;
		ContentValues val = new ContentValues ( );
		
		val.put(T_TID, t.getTestID());
		val.put(T_AID, t.getAnswerID());
		val.put(T_TQID, t.getQuestionID());
		val.put(T_ANS, t.getAnswer());
		val.put(T_TQW, t.getWrong());
		val.put(T_TDATE, t.getTestdate());
		val.put(T_TSID, t.getSubjectID());
		
		try {
			db.insert(DB_TABLE2, null, val);
		} catch (Exception e) {
			// TODO Auto-generated catch block
			e.printStackTrace();
			return false;
		}
		return ret;
	}
	
	public boolean UpdateUserTest ( Test t, String selectedAns, Question q ) {
		db = dbHelper.getWritableDatabase();
		boolean ret = true;

		Log.d ( TAG, "ANS:"+selectedAns);
		Log.d ( TAG, "ANS:" + t.getAnswerID());
		String strSQL = "";
		try {
			if ( selectedAns.compareTo(q.getQ_a()) == 0) {
				Log.d ( TAG, "RIGHT Ans");
				strSQL = String.format("UPDATE %s SET %s = '%s', %s = 1 WHERE %s = %s", DB_TABLE2, T_ANS, selectedAns, T_TQW, T_AID, t.getAnswerID());
			}
			else {
				Log.d ( TAG, "WRONG ANS");
				strSQL = String.format("UPDATE %s SET %s = '%s', %s = 0 WHERE %s = %s", DB_TABLE2, T_ANS, selectedAns, T_TQW, T_AID, t.getAnswerID());
			}
			Log.d ( TAG, strSQL);
			db.execSQL(strSQL);
			//db.update(DB_TABLE2, val, T_AID+"="+t.getAnswerID(), null);
		} catch (Exception e) {
			// TODO Auto-generated catch block
			e.printStackTrace();
			return false;
		}
		return ret;
	}
	
	public int getMaxTestID ( ) {
		Log.d ( TAG, "In getMaxTestID");
		int max=0;
		db = dbHelper.getReadableDatabase();
		Cursor c = db.query(DB_TABLE2, new String [] { "MAX("+ T_TID + ")" }, null, null, null, null, null);
		if ( c.moveToFirst()) {
			while ( c.isAfterLast() == false ) {
				max = c.getInt(c.getColumnIndex(c.getColumnName(0)));
				c.moveToNext();
			}
		}
		c.close();
		Log.d ( TAG, "MAX TID: " + max);
		return max;
	}
	
	public String getUserTestAnswer ( int aid ) {
		Log.d ( TAG, "INSIDE getUserTestAnswer");
		db = dbHelper.getReadableDatabase();
		String s="";
		Cursor c = db.query(DB_TABLE2, new String []{ T_ANS }, T_AID + "=" + aid, null, null, null, null);
		if ( c.moveToFirst()) {
			while ( c.isAfterLast() == false ) {
				s = c.getString(c.getColumnIndex( T_ANS ));
				c.moveToNext();
			}
		}
		return s;
	}

	public int getMaxAnswerID ( ) {
		Log.d ( TAG, "In getMaxAnsID");
		int max=0;
		db = dbHelper.getReadableDatabase();
		Cursor c = db.query(DB_TABLE2, new String [] { "MAX("+ T_AID + ")" }, null, null, null, null, null);
		if ( c.moveToFirst()) {
			while ( c.isAfterLast() == false ) {
				max = c.getInt(c.getColumnIndex(c.getColumnName(0)));
				c.moveToNext();
			}
		}
		c.close();
		Log.d ( TAG, "MAX AID: " + max);
		return max;
	}
	
	public Cursor getTestResult ( int iTID ) {
		Log.d ( "TAG", "Calculating Result");
		db = dbHelper.getReadableDatabase();
		//return ( db.query(DB_TABLE2, new String[] { "COUNT("+T_TQW+")" }, T_TQW + " = " + iTID + " AND " + T_TQW + " = 0", null, null, null, null));
		return ( db.rawQuery("SELECT COUNT(wrong) FROM tests WHERE t_id = " + iTID + " AND wrong = 0", null ));
	}
	
	public Cursor getPreviousTestResults ( ) {
		Log.d ( TAG, "PreviousTestResults" );
		db = dbHelper.getReadableDatabase();
		//return db.query(DB_TABLE2, new String[] { "COUNT("+T_TQW+")", T_TDATE }, null, null, T_TID, null, null);
		return ( db.rawQuery("SELECT _id, SUM(wrong), date, t_sid FROM tests GROUP BY t_id ORDER BY date DESC", null ));
	}

	
	public void CloseDB ( ) {
		dbHelper.close();
	}

