			db.execSQL("INSERT INTO questions VALUES(1137,13,'It is appropriate to compensate someone if youhave damaged his or her property in some way.This is called Restitution.Which situationbelow is the best example of Restitution?','a. Jake borrows Leslie`s camera and the lensshatters when it falls on the ground becausehe fails to zipper the case.When Jakereturns the camera, he tells Leslie that hewill pay for the repair.','b. Rebecca borrows her neighbors car, andwhen she returns it, the gas tank is practicallyempty. She apologizes profusely andtells her neighbor she will be more consideratethe next time.','c. Aaron asks Tom to check in on his apartmentwhile he is out of town.When Tomarrives, he discovers that a pipe has burstand there is a considerable amount of waterdamage. He calls a plumber to repair thepipe.','d. Lisa suspects that the pothole in her companysparking lot caused her flat tire. Shetells her boss that she thinks the companyshould pay for the repair.','','','a. Jake borrows Leslies camera and the lensshatters when it falls on the ground becausehe fails to zipper the case.When Jakereturns the camera, he tells Leslie that hewill pay for the repair.');");
			db.execSQL("INSERT INTO questions VALUES(1138,13,'People speculate when they consider a situationand assume something to be true basedon inconclusive evidence. Which situationbelow is the best example of Speculation?','a. Francine decides that it would be appropriateto wear jeans to her new office on Fridayafter reading about Casual Fridays in heremployee handbook.','b. Mary spends thirty minutes sitting in trafficand wishes that she took the train insteadof driving.','c. After consulting several guidebooks and hertravel agent, Jennifer feels confident thatthe hotel she has chosen is first-rate.','d. When Emily opens the door in tears, Theoguesses that shes had a death in her family.','','','d. When Emily opens the door in tears, Theoguesses that shes had a death in her family.');");
			db.execSQL("INSERT INTO questions VALUES(1139,13,'A Guarantee is a promise or assurance thatattests to the quality of a product that iseither (1) given in writing by the manufactureror (2) given verbally by the person sellingthe product. Which situation below is thebest example of a Guarantee?','a. Melissa purchases a DVD player with thehighest consumer ratings in its category.','b. The salesperson advises Curt to be sure thathe buys an air conditioner with a guarantee.','c. The local auto body shop specializes inrefurbishing and selling used cars.','d. Lori buys a used digital camera from hercoworker who says that she will refundLoris money if the cameras performance isnot of the highest quality.','','','d. Lori buys a used digital camera from hercoworker who says that she will refundLoris money if the cameras performance isnot of the highest quality.');");
			db.execSQL("INSERT INTO questions VALUES(1140,13,'Reentry occurs when a person leaves his orher social system for a period of time andthen returns. Which situation below bestdescribes Reentry?','a. When he is offered a better paying position,Jacob leaves the restaurant he manages tomanage a new restaurant on the other sideof town.','b. Catherine is spending her junior year ofcollege studying abroad in France.','c. Malcolm is readjusting to civilian life aftertwo years of overseas military service.','d. After several miserable months, Sharondecides that she can no longer share anapartment with her roommate Hilary.','','','c. Malcolm is readjusting to civilian life aftertwo years of overseas military service.');");
