			//db.execSQL("INSERT INTO questions VALUES(2018,20,'A merchant buys two articles for Rs.600. He sells one of them at a profit of 22% and the other at a loss of 8% and makes no profit or loss in the end. What is the selling price of the article that he sold at a loss?','1. Rs. 404.80','2. Rs. 440','3. Rs. 536.80','4. Rs. 160','','','1. Rs. 404.80');INSERT INTO questions VALUES(2019,20,'A trader professes to sell his goods at a loss of 8% but weights 900 grams in place of a kg weight. Find his real loss or gain per cent.','1. 2% loss','2. 2.22% gain','3. 2% gain','4. None of these','','','2. 2.22% gain');INSERT INTO questions VALUES(2020,20,'Rajiv sold an article for Rs.56 which cost him Rs.x. If he had gained x% on his outlay, what was his cost?','1. Rs. 40','2. Rs. 45','3. Rs. 36','4. Rs. 28','','','1. Rs. 40');INSERT INTO questions VALUES(2021,20,'A trader buys goods at a 19% Aount on the label price. If he wants to make a profit of 20% after allowing a Aount of 10%, by what % should his marked price be greater than the original label price?','1. +8%','2. -3.8%','3. +33.33%','4. None of these','','','1. +8%');INSERT INTO questions VALUES(2022,20,'If apples are bought at the rate of 30 for a rupee. How many apples must be sold for a rupee so as to gain 20%?','1. 28','2. 25','3. 20','4. 22','','','2. 25');INSERT INTO questions VALUES(2023,20,'One year payment to the servant is Rs. 200 plus one shirt. The servant leaves after 9 months and recieves Rs. 120 and a shirt. Then find the price of the shirt.','1. Rs. 80','2. Rs. 100','3. Rs. 120','4. Cannot be determined','','','3. Rs. 120');INSERT INTO questions VALUES(2025,20,'A merchant marks his goods in such a way that the profit on sale of 50 articles is equal to the selling price of 25 articles. What is his profit margin?','1. 25%','2. 50%','3. 100%','4. 66.67%','','','3. 100%');INSERT INTO questions VALUES(2026,20,'A merchant marks his goods up by 75% above his cost price. What is the maximum % Aount that he can offer so that he ends up selling at no profit or loss?','1. 75%','2. 46.67%','3. 300%','4. 42.85%','','','4. 42.85%');INSERT INTO questions VALUES(2029,20,'A man and a woman 81 miles apart from each other, start travelling towrds each other at the same time. If the man covers 5 miles per hour to the women`s 4 miles per hour, how far will the woman have travelled when they meet?','1. 27','2. 36','3. 45','4. None of these','','','2. 36');INSERT INTO questions VALUES(2030,20,'The speed of a motor boat itself is 20 km/h and the rate of flow of the river is 4 km/h. Moving with the stream the boat went 120 km. What distance will the boat cover during the same time going against the stream?','1. 80 km','2. 180 km','3. 60 km','4. 100 km','','','1. 80 km');INSERT INTO questions VALUES(2032,20,'I travel the first part of my journey at 40 kmph and the second part at 60 kmph and cover the total distance of 240 km to my destination in 5 hours. How long did the first part of my journey last?','1. 4 hours','2. 2 hours','3. 3 hours','4. 2 hours 24 minutes','','','3. 3 hours');INSERT INTO questions VALUES(2033,20,'By walking at 3/4th of his usual speed, a man reaches office 20 minutes later than usual. What is his usual time?','1. 30 min','2. 60 min','3. 70 min','4. 50 min','','','2. 60 min');INSERT INTO questions VALUES(2034,20,'A passenger train covers the distance between stations X and Y, 50 minutes faster than a goods train. Find this distance if the average speed of the passenger train is 60 kmph and that of goods train is 20 kmph.','1. 20 kms','2. 25 kms','3. 45 kms','4. 40 kms','','','2. 25 kms');INSERT INTO questions VALUES(2036,20,'Ram covers a part of the journey at 20 kmph and the balance at 70 kmph taking total of 8 hours to cover the distance of 400 km. How many hours has been driving at 20 kmph?','1. 2 hours','2. 3 hours 20 minutes','3. 4 hours 40 minutes','4. 3 hours 12 minutes','','','4. 3 hours 12 minutes');INSERT INTO questions VALUES(2038,20,'Two trains, 200 and 160 meters long take a minute to cross each other while traveling in the same direction and take only 10 seconds when they cross in opposite directions. What are the speeds at which the trains are traveling?','1. 21 m/s; 15 m/s','2. 30 m/s; 24 m/s','3. 18 m/s; 27 m/s','4. 15 m/s; 24 m/s','','','1. 21 m/s; 15 m/s');INSERT INTO questions VALUES(2040,20,'A train travels at an average speed of 90 km/hr without any stoppages. However, its average speed decrease to 60km/hr on account of stoppages. On an average, how many minutes per hour does the train stop?','1. 12 minutes','2. 18 minutes','3. 24 minutes','4. 20 minutes','','','4. 20 minutes');INSERT INTO questions VALUES(2042,20,'A man moves from A to B at the rate of 4 km/hr. Had he moved at the rate of 3.67 km/hr, he would have taken 3 hours more to reach the destination. What is the distance between A and B?','1. 33 kms','2. 132 kms','3. 36 kms','4. 144 kms','','','2. 132 kms');INSERT INTO questions VALUES(2044,20,'A man driving his bike at 24 kmph reaches his office 5 minutes late. Had he driven 25% faster on an average he would have reached 4 minutes earlier than the scheduled time. How far is his office?','1. 24 km','2. 72 km','3. 18 km','4. Data Insufficient','','','3. 18 km');INSERT INTO questions VALUES(2046,20,'If the wheel of a bicycle makes 560 revolutions in travelling 1.1 km, what is its radius?','1. 31.25 cm','2. 37.75 cm','3. 35.15 cm','4. 11.25 cm','','','1. 31.25 cm');INSERT INTO questions VALUES(2048,20,'Pipe A can fill a tank in `a` hours. On account of a leak at the bottom of the tank it takes thrice as long to fill the tank. How long will the leak at the bottom of the tank take to empty a full tank, when pipe A is kept closed?','1. (3/2)a hours','2. (2/3)a','3. (4/3)a','4. (3/4)a','','','1. (3/2)a hours');INSERT INTO questions VALUES(2049,20,'A and B working together can finish a job in T days. If A works alone and completes the job, he will take T + 5 days. If B works alone and completes the same job, he will take T + 45 days. What is T?','1. 25','2. 60','3. 15','4. None of these','','','3. 15');INSERT INTO questions VALUES(2050,20,'A man can do a piece of work in 60 hours. If he takes his son with him and both work together then the work is finished in 40 hours. How long will the son take to do the same job, if he worked alone on the job?','1. 20 hours','2. 120 hours','3. 24 hours','4. None of these','','','2. 120 hours');INSERT INTO questions VALUES(2051,20,'A, B and C can do a work in 5 days, 10 days and 15 days respectively. They started together to do the work but after 2 days A and B left. C did the remaining work (in days)','1. 1','2. 3','3. 5','4. 4','','','4. 4');INSERT INTO questions VALUES(2052,20,'X alone can do a piece of work in 15 days and Y alone can do it in 10 days. X and Y undertook to do it for Rs. 720. With the help of Z they finished it in 5 days. How much is paid to Z?','1. Rs. 360','2. Rs. 120','3. Rs. 240','4. Rs. 300','','','2. Rs. 120');INSERT INTO questions VALUES(2053,20,'Ram starts working on a job and works on it for 12 days and completes 40% of the work. To help him complete the work, he employs Ravi and together they work for another 12 days and the work gets completed. How much more efficient is Ram than Ravi?','1. 50%','2. 200%','3. 60%','4. 100%','','','4. 100%');INSERT INTO questions VALUES(2054,20,'A red light flashes 3 times per minute and a green light flashes 5 times in two minutes at regular intervals. If both lights start flashing at the same time, how many times do they flash together in each hour?','1. 30','2. 24','3. 20','4. 60','','','1. 30');INSERT INTO questions VALUES(2055,20,'A and B can do a piece of work in 21 and 24 days respectively. They started the work together and after some days A leaves the work and B completes the remaining work in 9 days. After how many days did A leave?','1. 5','2. 7','3. 8','4. 6','','','2. 7');INSERT INTO questions VALUES(2056,20,'Ram, who is half as efficient as Krish, will take 24 days to complete a work if he worked alone. If Ram and Krish worked together, how long will they take to complete the work?','1. 16 days','2. 12 days','3. 8 days','4. 18 days','','','3. 8 days');INSERT INTO questions VALUES(2057,20,'A number is selected at random from first thirty natural numbers. What is the chance that it is a multiple of either 3 or 13?','1. 17/30','2. 2/5','3. 11/30','4. 4/15','','','2. 2/5');INSERT INTO questions VALUES(2058,20,'What is the probability of getting at least one six in a single throw of three unbiased dice?','1. 1 / 6','2. 125 / 216','3. 1 / 36','4. 91 / 216','','','4. 91 / 216');INSERT INTO questions VALUES(2059,20,'What is the probability that a two digit number selected at random will be a multiple of `3` and not a multiple of `5`?','1. 2 / 15','2. 4 / 15','3. 1 / 15','4. 4 / 90','','','2. 4 / 15');INSERT INTO questions VALUES(2061,20,'Two squares are chosen at random on a chessboard. What is the probability that they have a side in common?','1. 1 / 18','2. 64 / 4032','3. 63 / 64','4. 1 / 9','','','1. 1 / 18');INSERT INTO questions VALUES(2062,20,'When two dice are thrown simultaneously, what is the probability that the sum of the two numbers that turn up is less than 11?','1. 5 / 6','2. 11 / 12','3. 1 / 6','4. 1 / 12','','','2. 11 / 12');INSERT INTO questions VALUES(2063,20,'When 4 dice are thrown, what is the probability that the same number appears on each of them?','1. 1/36','2. 1/18','3. 1/216','4. 1/5','','','3. 1/216');INSERT INTO questions VALUES(2064,20,'An experiment succeeds twice as often as it fails. What is the probability that in the next 5 trials there will be four successes?','1. 0','2. (2/3)^4','3. 5*((2/3)^4)*(1/3)','4. ((2/3)^4)*(1/3)','','','3. 5*((2/3)^4)*(1/3)');INSERT INTO questions VALUES(2066,20,'A can complete a project in 20 days and B can complete the same project in 30 days. If A and B start working on the project together and A quits 10 days before the project is completed, in how many days will the project be completed?','1. 18 days','2. 27 days','3. 26.67 days','4. 16 days','','','1. 18 days');INSERT INTO questions VALUES(2067,20,'Which amongst the following investments has the lowest return?a. 7% Rs.100 shares at Rs.120b. 8% Rs.10 shares at 13.50c. 9% Rs.50 shares at Rs.54','1. a','2. b','3. c','4. a and c','','','1. a');INSERT INTO questions VALUES(2069,20,'How many squares can be formed using the checkered 1 * 1 squares in a normal chessboard?','1. 64','2. 204','3. 1296','4. 65','','','2. 204');INSERT INTO questions VALUES(2070,20,'Solve for real `x` if :','1. x > 9','2. 0 < x < 9','3. x < 0','4. None of these','','','2. 0 < x < 9');INSERT INTO questions VALUES(2071,20,'If log 2 = 0. 3010, then find how many digits are contained in the number 256.','1. 15','2. 16','3. 17','4. Cannot be determined','','','3. 17');INSERT INTO questions VALUES(2073,20,'From the following choices what is the equation of a line whose x intercept is half as that of the line 3x + 4y = 12 and y intercept is twice as that of the same line.','1. 3x + 8y = 24','2. 8x + 3y = 24','3. 16x + 3y = 24','4. 3x + y = 6','','','4. 3x + y = 6');INSERT INTO questions VALUES(2074,20,'Pipe A can fill a tank completely in 5 hours. However, on account of a leak at the bottom of the tank, it takes 3 more hours to fill the tank. How long will the leak take to empty a full tank, when pipe A is shut?','1. 13 hours 20 minutes','2. 7.5 hours','3. 14 hours 40 minutes','4. None of these','','','1. 13 hours 20 minutes');INSERT INTO questions VALUES(2075,20,'The sum of the first 50 terms common to the series 15,19,23 ... and 14,19,24 ... is','1. 25450','2. 24550','3. 50900','4. Cannot be determined','','','1. 25450');INSERT INTO questions VALUES(2076,20,'For what values of `x` will the function be defined in the real domain?','1. -10 < x < 4','2. 4 < x < 10','3. x does not lie between the closed interval 10 and 4','4. x does not lie between the open interval 4 and 10','','','4. x does not lie between the open interval 4 and 10');INSERT INTO questions VALUES(2077,20,'Find the sum of all the integers which are multiples of 7 and lie between 200 and 400.','1. 8729','2. 8700','3. 8428','4. None of these','','','1. 8729');INSERT INTO questions VALUES(2078,20,'How many digits will the number 3200 have if the value of log 3 = 0.4771?','1. 95','2. 94','3. 96','4. None of these','','','3. 96');INSERT INTO questions VALUES(2080,20,'The sum of the first and the 9th of an arithmetic progression is 24. What is the sum of the first nine terms of the progression?','1. 216','2. 108','3. 54','4. None of these','','','2. 108');INSERT INTO questions VALUES(2081,20,'What is the equation of the line that is parallel to the line 3x + 7y = 10 and passes through the point (4, 8)','1. 7x - 3y = 46','2. 3x + 7y = 44','3. 9x + 21y - 184 = 0','4. 3x + 7y = 68','','','4. 3x + 7y = 68');INSERT INTO questions VALUES(2083,20,'Ram buys Rs.100 shares at Rs.112. If he sells the shares after a year at Rs.132 after receiving a dividend of 8% just before selling, what is the net yield on his investment?','1. 17.85%','2. 6.06%','3. 32%','4. 25%','','','4. 25%');INSERT INTO questions VALUES(2084,20,'The sum of 20 terms of the series 12 + 22, 32 + 42, 52 + 62 is:','1. 210','2. 519','3. 190','4. None of these.','','','1. 210');INSERT INTO questions VALUES(2087,20,'A trader makes a profit equal to the selling price of 75 articles when he sold 100 of the articles. What % profit did he make in the transaction?','1. 33.33%','2. 75%','3. 300%','4. 150%','','','3. 300%');INSERT INTO questions VALUES(2088,20,'A merchant buys two articles for Rs.600. He sells one of them at a profit of 22% and the other at a loss of 8% and makes no profit or loss in the end. What is the selling price of the article that he sold at a loss?','1. Rs. 404.80','2. Rs. 440','3. Rs. 536.80','4. Rs. 160','','','1. Rs. 404.80');INSERT INTO questions VALUES(2089,20,'Rajiv sold an article for Rs.56 which cost him Rs.x. If he had gained x% on his outlay, what was his cost?','1. Rs. 40','2. Rs. 45','3. Rs. 36','4. Rs. 28','','','1. Rs. 40');INSERT INTO questions VALUES(2090,20,'A trader buys goods at a 19% Aount on the label price. If he wants to make a profit of 20% after allowing a Aount of 10%, by what % should his marked price be greater than the original label price?','1. +8%','2. -3.8%','3. +33.33%','4. None of these','','','1. +8%');INSERT INTO questions VALUES(2091,20,'If apples are bought at the rate of 30 for a rupee. How many apples must be sold for a rupee so as to gain 20%?','1. 28','2. 25','3. 20','4. 22','','','2. 25');INSERT INTO questions VALUES(2092,20,'One year payment to the servant is Rs. 200 plus one shirt. The servant leaves after 9 months and recieves Rs. 120 and a shirt. Then find the price of the shirt.','1. Rs. 80','2. Rs. 100','3. Rs. 120','4. Cannot be determined','','','3. Rs. 120');INSERT INTO questions VALUES(2094,20,'A merchant marks his goods in such a way that the profit on sale of 50 articles is equal to the selling price of 25 articles. What is his profit margin?','1. 25%','2. 50%','3. 100%','4. 66.67%','','','3. 100%');INSERT INTO questions VALUES(2095,20,'A merchant marks his goods up by 75% above his cost price. What is the maximum % Aount that he can offer so that he ends up selling at no profit or loss?','1. 75%','2. 46.67%','3. 300%','4. 42.85%','','','4. 42.85%');INSERT INTO questions VALUES(2097,20,'For which of the following expressions is it true that the value of the expression is the same forx = 587 as for x = -587 ?I. 1 - 2xII. 1 - 2x2III. (1 - 2x)2','(A) I only','(B) II only','(C) I and III only','(D) II and III only','(E) I, II, and III','','(B) II only');INSERT INTO questions VALUES(2098,20,'If the numbers 17/24, 1/2, 3/8, 3/4 and 9/16were ordered from greatest to least, the middlenumber of the resulting sequence would be','(A) 17/24','(B) 1/2','(C) 3/8','(D) 3/4','(E) 9/16','','(E) 9/16');INSERT INTO questions VALUES(2099,20,'The sum 7/8 + 1/9 is between','A. 1/2 and 3/4','B. 7/8 + 1/9 and 1','C. 1 and 1.1/4','D. 1.1/4 and 1.1/2','E. 1.1/2 and 2','','B. 7/8 + 1/9 and 1');INSERT INTO questions VALUES(2100,20,'Of the following, which is closest to 1/7?','(A) 0.200','(B) 0.172','(C) 0.167','(D) 0.143','(E) 0.140','','(D) 0.143');INSERT INTO questions VALUES(2101,20,'For all integers a, b , c , and d , *(a,b,c,d ) is defined as a - b + c - d . What is thevalue of *(1,3,8,5) ?','(A) -1','(B) 0','(C) 1','(D) 2','(E) 3','','(C) 1');INSERT INTO questions VALUES(2102,20,'The operation # is defined by the equation x#y = x-y/2x-y, where 2x # y . The value ofwhich of the following is 0?','(A) - 2#2','(B) 2#-2','(C) 2#2','(D) 2#1','(E) 3#2','','(C) 2#2');INSERT INTO questions VALUES(2103,20,'The number 0.756 is how much greater than 3/4?','25-Jun','3/125','3/250','3/500','1/250','','3/250');INSERT INTO questions VALUES(2104,20,'What number when multiplied by 4/7 yield 6/7 as the result?','A. 2/7','B. 2/3','C. 3/2','D. 24/7','E. 7/2','','C. 3/2');INSERT INTO questions VALUES(2105,20,'If the sum of 3 times n, 11 times n, and 111 times n is equal to 1,000, what is the value ofn?','(A) 8','(B) 12.5','(C) 16','(D) 25','(E) 125','','(A) 8');INSERT INTO questions VALUES(2106,20,'Which of the following is equal to 0.042?','A. 4/10 + 2/10','B. 4/10 + 2/100','C. 4/100 + 2/100','D. 4/100 + 2/1000','E. 4/1000 + 2/1000','','D. 4/100 + 2/1000');INSERT INTO questions VALUES(2107,20,'In the addition problem above, if ? and D each represent a digit, then ? represents','(A) 9','(B) 8','(C) 5','(D) 2','(E) 0','','(A) 9');INSERT INTO questions VALUES(2108,20,'If ? represents a digit in the subtraction problem above, ? =','(A) 1','(B) 5','(C) 6','(D) 7','(E) 9','','(E) 9');INSERT INTO questions VALUES(2109,20,'Of the following, which is the closest approximation of50.2 x 0.49/199.8?','A. 1/10','B. 1/8','C. 1/4','D. 5/4','E. 25/2','','B. 1/8');INSERT INTO questions VALUES(2110,20,'The expression above is approximately equal to','(A) 1','(B) 3','(C) 4','(D) 5','(E) 6','','(B) 3');INSERT INTO questions VALUES(2111,20,'(2)(0.33)(15)/(0.24) is approximately equal to','(A) 2','(B) 5/2','(C) 15','(D) 36','(E) 40','','(E) 40');INSERT INTO questions VALUES(2112,20,'Of the following, which is the best approximation for (0.01)(2.005)(32.98)/(11.12)(0.04) ?','(A) 0.015','(B) 0.15','(C) 1.5','(D) 15','(E) 150','','(C) 1.5');INSERT INTO questions VALUES(2113,20,'Of the following, the closest approximation to(8.097)(0.8745)/(0.202)is','(A) 40','(B) 35','(C) 30','(D) 4','(E) 3','','(B) 35');INSERT INTO questions VALUES(2114,20,'If a sequence of 8 consecutive odd integers with increasing values has 9 as its 7th term, what isthe sum of the terms of the sequence?','(A) 22','(B) 32','(C) 36','(D) 40','(E) 44','','(B) 32');INSERT INTO questions VALUES(2115,20,'If w, x, y, and z are positive and w/x = y/z , which of the following is NOT always true?','(A) wz = xy','(B) x/w = z/y','(C) x/y = z/w','(D) w+x/x = y+z/z','(E) x+w/w = z+y/y','','(C) x/y = z/w');INSERT INTO questions VALUES(2116,20,'Tamara saves $35 each week. If she now has $100 saved, in how many weeks can she firsthave enough saved to buy a lawn mower that costs $250?','(A) 2','(B) 3','(C) 4','(D) 5','(E) 6','','(D) 5');INSERT INTO questions VALUES(2117,20,'If x > 3,000 , then the value of x/2x+1is closest to','A. 1/6','B. 1/3','C. 10/21','D. 1/2','E. 3/2','','D. 1/2');INSERT INTO questions VALUES(2118,20,'A certain clock indicates 8 oclock. If the clock runs accurately for the next 11,995 hours,what hour will it indicate at the end of that time?','(A) 1 oclock','(B) 2 oclock','(C) 3 oclock','(D) 5 oclock','(E) 10 oclock','','(C) 3 oclock');INSERT INTO questions VALUES(2119,20,'If 1/2 the result obtained when 2 is subtracted from 5x is equal to the sum of 10 and 3x ,what is the value of x ?','(A) - 22','(B)  4','(C) 4','(D) 18','(E) 22','','(A) - 22');INSERT INTO questions VALUES(2120,20,'A light-year is approximately 6x10^12 miles. Approximately how many miles from Earthis a galaxy that is 2x10^6 light-years away?','(A) 3.0x10^6','(B) 1.2x10^18','(C) 1.2x10^19','(D) 1.2x10^72','(E) 1.2x10^73','','(C) 1.2x10^19');INSERT INTO questions VALUES(2121,20,'If it is 6:27 in the evening on a certain day, what time in the morning was it exactly 2,880,717minutes earlier? (Assume standard time in one location.)','(A) 6:22','(B) 6:24','(C) 6:27','(D) 6:30','(E) 6:32','','(D) 6:30');INSERT INTO questions VALUES(2122,20,'If the sum of two positive integers is 24 and the difference of their squares is 48, what is theproduct of the two integers?','(A) 108','(B) 119','(C) 128','(D) 135','(E) 143','','(E) 143');INSERT INTO questions VALUES(2123,20,'On a certain scale of intensity, each i ncrement of 10 in magnitude represents a tenfold increasein intensity. On this scale, an intensity corresponding to a magnitude of 165 is how manytimes an intensity corresponding to a magnitude of 125?','(A) 40','(B) 100','(C) 400','(D) 1,000','(E) 10,000','','(E) 10,000');INSERT INTO questions VALUES(2124,20,'In the formula V = 1/(2r)^3 , if r is halved, then V is multiplied by','(A) 64','(B) 8','(C) 1','(D) 1/8','(E) 1/64','','(B) 8');INSERT INTO questions VALUES(2125,20,'In the subtraction problem above, D , ?, and O represent different positive digits. If ?is 1greater than D , what is the value of O ?','(A) 9','(B) 7','(C) 5','(D) 3','(E) 2','','(A) 9');INSERT INTO questions VALUES(2141,20,'If x is an even integer and y is an odd integer, which of the following CANNOT be true?','(E) xy is an even integer.','(D) y is a multiple of x .','(C) x is a multiple of y .','(B) y^x is an odd integer.','(A) x^y is an even integer.','','(D) y is a multiple of x .');INSERT INTO questions VALUES(2142,20,'If x is an even integer, which of the following is an odd integer?','(E) x^3','(D) x^2','(C) 8x + 5','(B) 7x','(A) 3x + 2','','(C) 8x + 5');INSERT INTO questions VALUES(2143,20,'If x is a positive odd integer and y is a negative even integer, which of the following couldbe a negative odd integer?','(E) x + y^2','(D) x^2 + y','(C) x - y','(B) xy','(A) y^x','','(D) x^2 + y');INSERT INTO questions VALUES(2144,20,'An integer n that is greater than 1 is said to be prime-saturated if it has no prime factorgreater than or equal to SQRoot(n) . Which of the following integers is prime-saturated?','(E) 75','(D) 66','(C) 46','(B) 35','(A) 6','','(E) 75');INSERT INTO questions VALUES(2145,20,'If a,b , and c are three consecutive odd integers such that 10 < a < b < c < 20 and if band c are prime numbers, what is the value of a + b ?','(E) 36','(D) 32','(C) 30','(B) 28','(A) 24','','(D) 32');INSERT INTO questions VALUES(2146,20,'If n is a positive integer, which of the following could be a prime number?','(E) 6n+4','(D) 6n+3','(C) 6n+2','(B) 6n+1','(A) 6n','','(B) 6n+1');INSERT INTO questions VALUES(2147,20,'What is the least common multiple of 3, 4, 5, and 8?','(E) 60','(D) 105','(C) 120','(B) 240','(A) 480','','(C) 120');INSERT INTO questions VALUES(2148,20,'Which of the following is NOT a factor of 252?','(D) 7','(C) 6','(B) 3','(A) 2','(E) 8','','(E) 8');INSERT INTO questions VALUES(2149,20,'There are 125 chips on a table. If as many of the chips as possible are to be arranged into anequal number of 3-chip and 4-chip stacks and the remaining chips are to be removed, howmany of the chips are to be removed?','(A) One','(B) Two','(C) Five','(D) Six','(E) Seven','','(D) Six');INSERT INTO questions VALUES(2150,20,'The values of x, y, and z are shown above. Which of the following gives these numbersin order from least to greatest?','(A) x, y, z','(B) x, z, y','(C) y, z, x','(D) z, y, x','(E) z, x, y','','(E) z, x, y');INSERT INTO questions VALUES(2151,20,'If x and y are positive integers, which of the following is NOT necessarily an integer?','(A) x + y','(B) x - y','(C) x/y','(D) xy','(E) x^y','','(E) z, x, y');INSERT INTO questions VALUES(2152,20,'What is the least odd integer, greater than 1, that is both the square of an integer and the cubeof an integer?','(A) 9','(B) 27','(C) 81','(D) 243','(E) 729','','(E) 729');INSERT INTO questions VALUES(2153,20,'What is the least possible product of 4 different integers, each of which has a value between 5and 10, inclusive?','(A) - 5040','(B) - 3600','(C) - 720','(D) - 600','(E) -120','','(B) - 3600');INSERT INTO questions VALUES(2154,20,'The number line above shows the position of a point that has coordinate x. Which of thefollowing statements about x must be true?I. 2 < x < 4II. - x < -3III. 0 < 2x -3<1','(A) I only','(B) II only','(C) III only','(D) I and II','(E) I and III','','(A) I only');INSERT INTO questions VALUES(2155,20,'Which of the following must be true?I. If a + b < a + c then b < c .II. If a^2.b < a^2.c then b < c .III. If b^2 < c^2 then b < c .','(A) None','(B) I only','(C) II only','(D) I and II only','(E) I, II, and III','','(D) I and II only');INSERT INTO questions VALUES(2156,20,'If x and y are two consecutive odd integers and x + y = 2(x - y)^2 , what is the value ofx + y ?','(A) 2','(B) 4','(C) 8','(D) 12','(E) 16','','(C) 8');INSERT INTO questions VALUES(2157,20,'Which of the following integers does NOT have a divisor greater than 1 that is the square ofan integer?','(A) 75','(B) 42','(C) 32','(D) 25','(E) 12','','(B) 42');INSERT INTO questions VALUES(2158,20,'When the integer n is divided by 6, the remainder is 3. Which of the following is NOT amultiple of 6?','(A) n - 3','(B) n + 3','(C) 2n','(D) 3n','(E) 4n','','(D) 3n');INSERT INTO questions VALUES(2159,20,'If the remainder is 7 when positive integer n is divided by 18, what is the remainder whenn is divided by 6?','(A) 0','(B) 1','(C) 2','(D) 3','(E) 4','','(B) 1');INSERT INTO questions VALUES(2160,20,'If the two-digit integers M and N are positive and have the same digits, but in reverseorder, which of the following CANNOT be the sum of M and N ?','(A) 181','(B) 165','(C) 121','(D) 99','(E) 44','','(A) 181');INSERT INTO questions VALUES(2161,20,'If the product of two positive integers is 630, which of the following must be true?I. Both integers are even numbers.II. At least one of the integers is a multiple of 3.III. One of the integers is 10.','(A) I only','(B) II only','(C) III only','(D) I and II','(E) II and III','','(B) II only');INSERT INTO questions VALUES(2162,20,'For any numbers a and b , a? b = a +b - ab. If a ?b = 0 , which of the followingCANNOT be a value of b ?','(A) 2','(B) 1','(C) 0','(D) -1','(E) -3/2','','(B) 1');INSERT INTO questions VALUES(2163,20,'When the integer k is divided by 12, the remainder is 3. Which of the following, whendivided by 12, will have a remainder of 6?I. 2kII. 6kIII. 4 k + 6','(A) I only','(B) II only','(C) III only','(D) I and II only','(E) I, II, and III','','(E) I, II, and III');INSERT INTO questions VALUES(2164,20,'What is the least number of digits (including repetitions) needed to express 10100 in decimalnotation?','(A) 4','(B) 100','(C) 101','(D) 1,000','(E) 1,001','','(C) 101');INSERT INTO questions VALUES(2165,20,'What is the smallest positive integer n for which 324 is a factor of n 6^n ?','(A) 2','(B) 3','(C) 4','(D) 5','(E) 6','','(C) 4');INSERT INTO questions VALUES(2166,20,'If n is an integer, which of the following CANNOT be a factor of 3n + 4 ?','(A) 4','(B) 5','(C) 6','(D) 7','(E) 8','','(C) 6');");
			//db.execSQL("INSERT INTO questions VALUES(1900,20,'Find the area of the triangle whose vertices are (-6, -2), (-4, -6), (-2, 5).','1. 36','2. 18','3. 15','4. 30','','','3. 15');INSERT INTO questions VALUES(1901,20,'A stairway 10ft high is such that each step accounts for half a foot upward and one-foot forward. What distance will an ant travel if it starts from ground level to reach the top of the stairway?','1. 30 ft','2. 33 ft','3. 10 ft','4. 29 ft','','','4. 29 ft');INSERT INTO questions VALUES(1902,20,'Each interior angle of a regular polygon is 120 degrees greater than each exterior angle. How many sides are there in the polygon?','1. 6','2. 8','3. 12','4. 3','','','3. 12');INSERT INTO questions VALUES(1903,20,'What is the area of the largest triangle that can be fitted into a rectangle of length `l` units and width `w` units?','1. lw/3','2. (2lw)/3','3. (3lw)/4','4. (lw)/2','','','4. (lw)/2');INSERT INTO questions VALUES(1904,20,'Which of the following is inCorrect?','1. An incentre is a point where the angle bisectors meet.','2. The median of any side of a triangle bisects the side at right angle.','3. The point at which the three altitudes of a triangle meet is the orthocentre','4. The point at which the three perpendicular bisectors meet is the centre of the circumcircle.','','','2. The median of any side of a triangle bisects the side at right angle.');INSERT INTO questions VALUES(1905,20,'A and B are two points with the co-ordinates (-2, 0) and (0, 5). What is the length of the diagonal AC if AB form one of the sides of the square ABCD?','1. units','2. units','3. units','4. units','','','2. units');INSERT INTO questions VALUES(1906,20,'What is the measure of the circum radius of a triangle whose sides are 9, 40 and 41?','1. 6','2. 4','3. 24.5','4. 20.5','','','4. 20.5');INSERT INTO questions VALUES(1907,20,'If the sum of the interior angles of a regular polygon measures up to 1440 degrees, how many sides does the polygon have?','1. 10 sides','2. 8 sides','3. 12 sides','4. 9 sides','','','1. 10 sides');INSERT INTO questions VALUES(1908,20,'If ABC is a right angle triangle with angle A = 900 and 2s = a + b + c, where a > b > c where notations have their usual meanings, then which one of the following is Correct?','1. (s - b) (s - c) > s (s - a)','2. (s - a) (s - c) > s (s - b)','3. (s - a) (s - b) < s (s - c)','4. 4s (s - a) (s - b) (s - c) = bc','','','3. (s - a) (s - b) < s (s - c)');INSERT INTO questions VALUES(1909,20,'What is the measure of in radius of the triangle whose sides are 24, 7 and 25?','1. 12.5','2. 3','3. 6','4. None of these','','','2. 3');INSERT INTO questions VALUES(1910,20,'What is the circum radius of a triangle whose sides are 7, 24 and 25 respectively?','1. 18','2. 12.5','3. 12','4. 14','','','2. 12.5');INSERT INTO questions VALUES(1911,20,'A regular hexagon is inscribed in a circle of radius r cms. What is the perimeter of the regular hexagon?','1. 3r','2. 6r','3. r','4. 9r','','','2. 6r');INSERT INTO questions VALUES(1912,20,'A 4 cm cube is cut into 1 cm cubes. What is the percentage increase in the surface area after such cutting?','1. 4%','2. 300%','3. 75%','4. 400%','','','2. 300%');INSERT INTO questions VALUES(1913,20,'If the diagonal and the area of a rectangle are 25 m and 168 m2, what is the length of the rectangle?','1. 17 m','2. 31 m','3. 12 m','4. 24 m','','','4. 24 m');INSERT INTO questions VALUES(1914,20,'The surface area of the three coterminous faces of a cuboid are 6, 15, 10 sq.cm respectively. Find the volume of the cuboid.','1. 30','2. 20','3. 40','4. 35','','','1. 30');INSERT INTO questions VALUES(1915,20,'If each interior angle of a regular polygon is 150 degrees, then it is','1. Octagon','2. Decagon','3. Dodecagon','4. Tetrahedron','','','3. Dodecagon');INSERT INTO questions VALUES(1917,20,'A 5 cm cube is cut into as many 1 cm cubes as possible. What is the ratio of the surface area of the larger cube to that of the sum of the surface areas of the smaller cubes?','1. 1 : 6','2. 1 : 5','3. 1 : 25','4. 1 : 125','','','2. 1 : 5');INSERT INTO questions VALUES(1918,20,'If the sides of a triangle measure 72, 75 and 21, what is the measure of its in radius?','1. 37.5','2. 24','3. 9','4. 15','','','3. 9');INSERT INTO questions VALUES(1919,20,'The circumference of the front wheel of a cart is 30 ft long and that of the back wheel is 36 ft long. What is the distance travelled by the cart, when the front wheel has done five more revolutions than the rear wheel?','1. 20 ft','2. 25 ft','3. 750 ft','4. 900 ft','','','4. 900 ft');INSERT INTO questions VALUES(1920,20,'The area of a square field is 24200 sq m. How long will a lady take to cross the field diagonally at the rate of 6.6 km/hr?','1. 3 minutes','2. 2 minutes','3. 2.4 minutes','4. 2 minutes 40 seconds','','','2. 2 minutes');INSERT INTO questions VALUES(1921,20,'a and b are the lengths of the base and height of a right angled triangle whose hypotenuse is h. If the values of a and b are positive integers, which of the following cannot be a value of the square of the hypotenuse?','1. 13','2. 23','3. 37','4. 41','','','2. 23');INSERT INTO questions VALUES(1922,20,'The angle of elevation of the top of a tower 30 m high, from two points on the level ground on its opposite sides are 45 degrees and 60 degrees. What is the distance between the two points?','1. 30','2. 51.96','3. 47.32','4. 81.96','','','3. 47.32');INSERT INTO questions VALUES(1923,20,'What is the value of cot 15o + cot 75o + cot 135o - cosec 30o?','1. 3','2. Infinity','3. 1','4. None of these','','','3. 1');INSERT INTO questions VALUES(1924,20,'Rs.432 is divided amongst three workers A, B and C such that 8 times A`s share is equal to 12 times B`s share which is equal to 6 times C`s share. How much did A get?','1. Rs.192','2. Rs.133','3. Rs.144','4. Rs.128','','','3. Rs.144');INSERT INTO questions VALUES(1925,20,'If 20 men or 24 women or 40 boys can do a job in 12 days working for 8 hours a day, how many men working with 6 women and 2 boys take to do a job four times as big working for 5 hours a day for 12 days?','1. 8 men','2. 12 men','3. 2 men','4. 24 men','','','3. 2 men');INSERT INTO questions VALUES(1926,20,'Two cogged wheels of which one has 32 cogs and other 54 cogs, work into each other. If the latter turns 80 times in three quarters of a minute, how often does the other turn in 8 seconds?','1. 48','2. 135','3. 24','4. None of these','','','3. 24');INSERT INTO questions VALUES(1927,20,'The monthly incomes of A and B are in the ratio 4 : 5, their expenses are in the ratio 5 : 6. If `A` saves Rs.25 per month and `B` saves Rs.50 per month, what are their respective incomes?','1. Rs.400 and Rs.500','2. Rs.240 and Rs.300','3. Rs.320 and Rs.400','4. Rs.440 and Rs.550','','','1. Rs.400 and Rs.500');INSERT INTO questions VALUES(1928,20,'The proportion of milk and water in 3 samples is 2:1, 3:2 and 5:3. A mixture comprising of equal quantities of all 3 samples is made. The proportion of milk and water in the mixture is','1. 2:1','2. 5:1','3. 99:61','4. 227:133','','','4. 227:133');INSERT INTO questions VALUES(1929,20,'A group of workers can do a piece of work in 24 days. However as 7 of them were absent it took 30 days to complete the work. How many people actually worked on the job to complete it?','1. 35','2. 30','3. 28','4. 42','','','3. 28');INSERT INTO questions VALUES(1930,20,'A, B and C play cricket. A`s runs are to B`s runs and B`s runs are to C`s as 3:2. They get altogether 342 runs. How many runs did A make?','1. 162','2. 108','3. 72','4. None of these','','','1. 162');INSERT INTO questions VALUES(1931,20,'The monthly salaries of two persons are in the ratio of 4:7. If each receives an increase of Rs.25 in the salary, the ratio is altered to 3: 5. Find their respective salaries.','1. 120 and 210','2. 80 and 140','3. 180 and 300','4. 200 and 350','','','4. 200 and 350');INSERT INTO questions VALUES(1932,20,'A fort has provisions for 60 days. If after 15 days 500 men strengthen them and the food lasts 40 days longer, how many men are there in the fort?','1. 3500','2. 4000','3. 6000','4. None of these','','','2. 4000');INSERT INTO questions VALUES(1933,20,'The ratio of marks obtained by vinod and Basu is 6:5. If the combined average of their percentage is 68.75 and their sum of the marks is 275, find the total marks for which exam was conducted.','1. 150','2. 200','3. 400','4. None of these.','','','2. 200');INSERT INTO questions VALUES(1934,20,'The present ages of A and B are as 6 : 4. Five years ago their ages were in the ratio 5 : 3. Find their present ages.','1. 42, 28','2. 36, 24','3. 30, 20','4. 25, 15','','','3. 30, 20');INSERT INTO questions VALUES(1936,20,'A, B and C, each of them working alone can complete a job in 6, 8 and 12 days respectively. If all three of them work together to complete a job and earn Rs.2340, what ill be C`s share of the earnings?','1. Rs.520','2. Rs.1080','3. Rs.1170','4. Rs.630','','','1. Rs.520');INSERT INTO questions VALUES(1938,20,'In what ratio must a person mix three kinds of tea costing Rs.60/kg, Rs.75/kg and Rs.100 /kg so that the resultant mixture when sold at Rs.96/kg yields a profit of 20%?','1. 1 : 2 : 4','2. 3 : 7 : 6','3. 1 : 4 : 2','4. None of these','','','3. 1 : 4 : 2');INSERT INTO questions VALUES(1939,20,'A merchant mixes three varieties of rice costing Rs.20/kg, Rs.24/kg and Rs.30/kg and sells the mixture at a profit of 20% at Rs.30 / kg. How many kgs of the second variety will be in the mixture if 2 kgs of the third variety is there in the mixture?','1. 1 kg','2. 5 kgs','3. 3 kgs','4. 6 kgs','','','2. 5 kgs');INSERT INTO questions VALUES(1940,20,'How many litres of water should be added to a 30 litre mixture of milk and water containing milk and water in the ratio of 7 : 3 such that the resultant mixture has 40% water in it?','1. 7 litres','2. 10 litres','3. 5 litres','4. None of these','','','3. 5 litres');INSERT INTO questions VALUES(1941,20,'How many kgs of Basmati rice costing Rs.42/kg 